are:ZpusobJednani.are:Text:
Za představenstvo navenek jménem společnosti jednají členové představenstva takto :
a) společně dva členové představenstva, z nichž alespoň jeden je předsedou nebo místopředsedou představenstva, ve všech ostatních záležitostech;
b) samostatně člen představenstva, jehož k tomuto jednání v určitém rozsahu nebo na určitou dobu představenstva pověří svým rozhodnutím;
c) společně všichni členové představenstva v záležitostech zcizování nebo zatěžování akcií a jiných účastnických podílů.
